  @override
  String get info_privacy_policy => 'Introduction.\n\nWe take your privacy rights very seriously and want you to feel comfortable on Zerobolas Marketplace. This privacy policy addresses personally identifiable information (designated \"data\" below) that is collected by us on our site. This policy does not apply to other entities that we do not own or control, or to persons who are not our employees or agents. Please take the time to read our terms of use.\n\n1. Data Collection.\n\nOur registration process requires a valid e-mail address, a user ID, a password and the required fields in bold. Providing us with other information is your option. Please note that your user name, e-mail address, or other submissions you make on this site may contain your real name or other personally identifiable information and, as a result, may appear on this site. Like many Internet sites, we may also automatically receive general information contained in our server log files such as your IP address or cookie information. Information about how classifieds may be served on this site (if at all), can be seen below. zerobolas.com may send notifications or messages from users interested in your ads through the e-mail address you used to subscribe. You can unsubscribe from these e-mails. zerobolas.com will not ask you by phone or email credit card details. The only time you should provide your data is online and directly through the payment gateway Stripe.com, 2Checkout.com, and PayPal.\n\n2. Consent to use of information.\n\nThe registration of account and publication of announcements in zerobolas.com implies that the information of the advertiser will be publicly available in our network of sites in order to facilitate to the potential interested consumers the contact with the advertiser.\n\nYou agree that zerobolas.com may provide or share information and data collected from your account and related accounts with the authorities, in cases where it deems appropriate or at the express request of these.\n\n3. Conditions of consent and account deletion.\n\nRegistered users who wish to delete their account, may request it via email through hola@zerobolas.com. This process may take between 3 and 5 business days. In emergency cases, the deletion of your account can be requested by phone by calling the phone numbers below. It is important to emphasize that in case of account deletion, zerobolas.com will unpublish the user\'s information and ads from its network of sites, however, the company does not control and is not responsible for the listings published in other search engines such as Google, Yahoo, Bing or any other site not related to zerobolas.com.\n\n4. Use of data\n\nWe may use data to modify and improve your experience as a user of this Site. We will make efforts so that your data will not be provided to third parties unless:\n\n4.1. otherwise provided for within this privacy policy;\n\n4.2. we obtain your consent, for example, when you choose to OPT-in or OPT-out to data sharing;\n\n4.3. a service provided on our site requires interaction with or is provided by a third party, by way of example an application service provider;\n\n4.4. pursuant to legal process or law enforcement;\n\n4.5. we find that through the use of this site you violate our policy, terms of service, other usage guidelines or as deemed reasonably necessary by us to protect our legal rights and/or property;\n\n4.6. this site is purchased by third parties whereby those third parties may use data in a manner similar to us as provided in this policy. In the event you choose to use links appearing on our site to visit other sites. You are advised to read the privacy policies posted on those sites.\n\n5. Cookies.\n\nLike many Internet sites, we set and use cookies to enhance your user experience, such as retaining your personal settings. Advertisements may appear on our Web site and, if so, may set and access cookies on your computer and are subject to the privacy policy of those parties providing the advertisement. More information about Cookies is available at: http://es.wikipedia.org/wiki/Cookie\n\n5.1.DoubleClick DART Cookie. Google uses the DoubleClick DART cookie on ads served on websites like this one that display AdSense ads for content. Use of the DART cookie enables Google to serve ads to users who visit their sites and other sites on the Internet. Google uses advertising partners to serve ads when users visit our website. These companies may use the information they obtain from visits to this and other websites (not including name, address, e-mail address or telephone number) to provide users with advertisements about products and services of interest to them. *As a user, you may opt out of the use of the DART cookie by visiting the Google ad and content network privacy policy: http://www.google.com/privacy_ads.html.\n\n5.2. Web Beacons This site may also host web beacons (also known as web bugs). Web beacons are usually small images of one pixel by one pixel, visible or invisible placed within the source code of the web pages of a site. Web beacons serve and are used in a similar way to cookies. In addition, web beacons are often used to measure the traffic of users visiting a web page in order to get a pattern of users of a site. More information about web beacons is available at: http://es.wikipedia.org/wiki/Web_bug.\n\n6. Children.\n\nWe do not allow persons under the age of thirteen (13) to be members of this site. For more information, please contact our webmaster.\n\n7. Correcting or removing your account information.\n\nWe give you the ability to correct the information in your user account that you provided to us at registration using your personal area of the site settings. You may request cancellation of your user account by contacting our webmaster. Content or other data that you may have provided that is not within your user account, such as messages that may appear within our forums, may continue to appear on our site at our discretion even if your user account is deleted. Please see our terms of use for more information.\n\n8. Change to this privacy policy.\n\nWe may make changes to this Privacy Policy at any time. We will notify you of material changes to this policy either by posting a prominent notice on our site and/or by sending you a message to the e-mail address you have provided to us and which is contained in your user settings.\n\n9. We Make No Warranties.\n\nWhile this Privacy Policy indicates that our standards for data maintenance and we will make efforts to meet them, we are not in a position to guarantee these standards. There may be factors beyond our control that may result in data access. Accordingly, we disclaim any warranties or representations concerning the maintenance or non-release of data.\n\n10. Contact Information.\n\nIf you have any questions about this Privacy Policy or our web site, please feel free to contact our webmaster.\n\n11. Emails\n\nIn order to stop receiving emails sent by zerobolas.gt, you must start by clicking the unsubscribe link located at the bottom of the email sent. Depending on your user level, you may unsubscribe immediately after clicking on the link. If you already have a properly registered user account, you will need to log in to the account with your password and login before clicking on Confirm Unsubscription.\n\nIf you only want to stop receiving certain emails from zerobolas.gt and not others, you can manage these options from your account. You enter your account from the Login. You enter your account with your login and password. Under the menu Profile > Settings > Notifications you can deselect the notifications you do not want to receive.';

